class GroupUserTree extends Component {
    constructor(props){
        super(props);
        this.state = {
            visible: this.props.visible?true:false
        }
    }
    componentWillReceiveProps(nextProps){
        if (nextProps.visible) {
            this.setState({
                visible: this.props.visible ? true : false
            });
        }
    }
    showModal(){
        this.setState({
            visible: true
        });
    }
    handleOk = (e) => {
        console.log(e);
        this.setState({
            visible: false,
        });
    }
    handleCancel = (e) => {
        console.log(e);
        this.setState({
            visible: false,
        });
    }
    render() {
        return (
            <div>
                <Modal
                    title="Basic Modal"
                    visible={this.state.visible}
                    onOk={this.handleOk}
                    onCancel={this.handleCancel}
                    maskClosable={false}
                    width={"1000px"}
                >
                    <Tree />
                </Modal>
            </div>
        );
    }
}
